(63, 1, '2019-01-22 09:53:23', '2019-01-22 11:53:23', '<b>Pula Pula Polvo</b>\r\n<b>Recomendado para Idade:</b> de 01 à 12 Anos.\r\n\r\nO Pula-Pula polvo tem um formato redondo com um polvo gigante em cima. As laterais dele são de rede, facilitando a visualização dos pais e uma maior segurança na hora da brincadeira.\r\n\r\n<b>Especificações do Produto</b>\r\nDiâmetro: 6,5 Metros\r\nBrinquedo Circular\r\n\r\n<b>Mais fotos:</b>', 'Pula Pula Polvo', '', 'publish', 'closed', 'closed', '', 'pula-pula-polvo', '', '', '2019-01-23 09:15:18', '2019-01-23 11:15:18', '', 0, 'http://temporario.agenciasense.com.br/pulapula/?page_id=63', 0, 'page', '', 0),
