(123, 1, '2019-01-22 15:57:24', '2019-01-22 17:57:24', '<b>Piscina de Bolinhas Castelinho</b>\r\n<b>Recomendado para Idade:</b> de 0 à 07 Anos.\r\n\r\nA Piscina de bolinhas inflável tem o formato de castelinho por ser uma mistura de pula-pula e piscina de bolinhas em um brinquedo só. Ela é toda inflável com suas laterais em redinha para visualização dos pais.\r\n\r\n<b>Especificações do Produto</b>\r\nAltura: x Metros\r\nLargura: x Metros\r\n\r\n<b>Mais fotos:</b>', 'Piscina de Bolinhas Castelinho', '', 'publish', 'closed', 'closed', '', 'piscina-de-bolinhas-castelinho', '', '', '2019-01-22 15:57:24', '2019-01-22 17:57:24', '', 0, 'http://temporario.agenciasense.com.br/pulapula/?page_id=123', 0, 'page', '', 0),
