(185, 1, '2019-01-23 09:12:03', '2019-01-23 11:12:03', '<b>Circuito de Obstáculos</b>\r\n<b>Recomendado para Idade:</b> de 05 à 10 Anos.\r\n\r\nO brinquedo Circuito de Obstáculos é como se fosse um labirinto, onde a criança entra pela frente e precisa atravessar todos os obstáculos que estão lá dentro, para chegar no final da competição. Ganha quem chegar primeiro.\r\n\r\n<b>Especificações do Produto</b>\r\nAltura: 7,5 Metros\r\nLargura: 3 Metros\r\n\r\n<b>Mais fotos:</b>', 'Circuito de Obstáculos', '', 'inherit', 'closed', 'closed', '', '81-revision-v1', '', '', '2019-01-23 09:12:03', '2019-01-23 11:12:03', '', 81, 'http://temporario.agenciasense.com.br/pulapula/2019/01/23/81-revision-v1/', 0, 'revision', '', 0),
(186, 1, '2019-01-23 09:12:44', '2019-01-23 11:12:44', '<b>Tobogã Jumbo</b>\r\n<b>Recomendado para Idade:</b> a partir de 05 Anos.\r\n\r\nO Tobogã Jumbo é nosso maior brinquedo, um escorregador inflável gigante com suporte até para os adultos que queiram brincar. Ideal para eventos com um público grande. Que tal animar sua festa com esse gigante da diversão?\r\n\r\n<b>Especificações do Produto</b>\r\nAltura: 4,5 Metros\r\nLargura: 10 Metros\r\n\r\n<b>Mais fotos:</b>', 'Tobogã Jumbo', '', 'inherit', 'closed', 'closed', '', '69-revision-v1', '', '', '2019-01-23 09:12:44', '2019-01-23 11:12:44', '', 69, 'http://temporario.agenciasense.com.br/pulapula/2019/01/23/69-revision-v1/', 0, 'revision', '', 0),
(187, 1, '2019-01-23 09:13:36', '2019-01-23 11:13:36', '<b>Kid Play Fantasia</b>\r\n<b>Recomendado para Idade:</b> de 02 à 12 Anos.\r\n\r\nO Kid play Fantasia é um pula-pula com alguns elementos interativos. Possui um mini tobogã, e alguns bonecos de joão bobo para a criançada se divertir.\r\n\r\n<b>Especificações do Produto</b>\r\nAltura: 5 Metros\r\nLargura: 5 Metros\r\n\r\n<b>Mais fotos:</b>', 'Kid Play Fantasia', '', 'inherit', 'closed', 'closed', '', '84-revision-v1', '', '', '2019-01-23 09:13:36', '2019-01-23 11:13:36', '', 84, 'http://temporario.agenciasense.com.br/pulapula/2019/01/23/84-revision-v1/', 0, 'revision', '', 0),
(188, 1, '2019-01-23 09:13:49', '2019-01-23 11:13:49', '<b>Kid Play Fazendinha</b>\r\n<b>Recomendado para Idade:</b> de 02 à 12 Anos.\r\n\r\nO Kid play Fazendinha é um pula-pula com alguns bichinhos infláveis da fazenda. Possui um mini tobogã, e alguns bonecos de joão bobo de bichinhos para a criançada se divertir. \r\n\r\n<b>Especificações do Produto</b>\r\nAltura: 5 Metros\r\nLargura: 5 Metros\r\n\r\n<b>Mais fotos:</b>', 'Kid Play Fazendinha', '', 'inherit', 'closed', 'closed', '', '75-revision-v1', '', '', '2019-01-23 09:13:49', '2019-01-23 11:13:49', '', 75, 'http://temporario.agenciasense.com.br/pulapula/2019/01/23/75-revision-v1/', 0, 'revision', '', 0),
(189, 1, '2019-01-23 09:14:02', '2019-01-23 11:14:02', '<b>Kid Play Clash of Clans</b>\r\n<b>Recomendado para Idade:</b> de 02 à 12 Anos.\r\n\r\nO Kid play Clash of Clans é um pula-pula com alguns elementos interativos. Possui um mini tobogã, e alguns bonecos de joão bobo para a criançada se divertir.\r\n\r\n<b>Especificações do Produto</b>\r\nAltura: 5 Metros\r\nLargura: 5 Metros\r\n\r\n<b>Mais fotos:</b>', 'Kid Play Clash of Clans', '', 'inherit', 'closed', 'closed', '', '59-revision-v1', '', '', '2019-01-23 09:14:02', '2019-01-23 11:14:02', '', 59, 'http://temporario.agenciasense.com.br/pulapula/2019/01/23/59-revision-v1/', 0, 'revision', '', 0),
(190, 1, '2019-01-23 09:15:03', '2019-01-23 11:15:03', '<b>Toboágua</b>\r\n<b>Recomendado para Idade:</b> a partir de 05 Anos.\r\n\r\nO Toboágua é um escorregador inflável, com um pula-pula na frente, podendo ser utilizado para crianças e adultos. É um brinquedo que chama atenção por onde passa devido a sua altura e suas cores. \r\n\r\n<b>Especificações do Produto</b>\r\nAltura: 8 Metros\r\nLargura: 3 Metros\r\nProfundidade: 6 Metros\r\n\r\n<b>Mais fotos:</b>', 'Toboágua', '', 'inherit', 'closed', 'closed', '', '78-revision-v1', '', '', '2019-01-23 09:15:03', '2019-01-23 11:15:03', '', 78, 'http://temporario.agenciasense.com.br/pulapula/2019/01/23/78-revision-v1/', 0, 'revision', '', 0),
(191, 1, '2019-01-23 09:15:18', '2019-01-23 11:15:18', '<b>Pula Pula Polvo</b>\r\n<b>Recomendado para Idade:</b> de 01 à 12 Anos.\r\n\r\nO Pula-Pula polvo tem um formato redondo com um polvo gigante em cima. As laterais dele são de rede, facilitando a visualização dos pais e uma maior segurança na hora da brincadeira.\r\n\r\n<b>Especificações do Produto</b>\r\nDiâmetro: 6,5 Metros\r\nBrinquedo Circular\r\n\r\n<b>Mais fotos:</b>', 'Pula Pula Polvo', '', 'inherit', 'closed', 'closed', '', '63-revision-v1', '', '', '2019-01-23 09:15:18', '2019-01-23 11:15:18', '', 63, 'http://temporario.agenciasense.com.br/pulapula/2019/01/23/63-revision-v1/', 0, 'revision', '', 0),
(192, 1, '2019-01-23 09:15:47', '2019-01-23 11:15:47', '<b>Pula Pula Castelinho</b>\r\n<b>Recomendado para Idade:</b> de 01 à 10 Anos.\r\n\r\nO Pula-Pula Castelinho é um brinquedo bem versátil, podendo ser instalado até em lugares pequenos, e em todas as ocasiões. Ideal para crianças pequenas.\r\n\r\n<b>Especificações do Produto</b>\r\nAltura: 3 Metros\r\nLargura: 4 Metros\r\n\r\n<b>Mais fotos:</b>', 'Pula Pula Castelinho', '', 'inherit', 'closed', 'closed', '', '66-revision-v1', '', '', '2019-01-23 09:15:47', '2019-01-23 11:15:47', '', 66, 'http://temporario.agenciasense.com.br/pulapula/2019/01/23/66-revision-v1/', 0, 'revision', '', 0),
(193, 1, '2019-01-23 09:16:31', '2019-01-23 11:16:31', '<b>Tobogã Stander</b>\r\n<b>Recomendado para Idade:</b> de 01 à 14 Anos.\r\n\r\nO Tobogã Stander é um escorregador inflável com entrada nas laterais e uma grande lona para escorregar. Possui paredes em todos os lados garantindo uma melhor segurança.\r\n\r\n<b>Especificações do Produto</b>\r\nAltura: X Metros\r\nLargura: X Metros\r\n\r\n<b>Mais fotos:</b>', 'Tobogã Stander', '', 'inherit', 'closed', 'closed', '', '99-revision-v1', '', '', '2019-01-23 09:16:31', '2019-01-23 11:16:31', '', 99, 'http://temporario.agenciasense.com.br/pulapula/2019/01/23/99-revision-v1/', 0, 'revision', '', 0),
(194, 1, '2019-01-23 09:16:43', '2019-01-23 11:16:43', '<b>Tobogã Barco Pirata</b>\r\n<b>Recomendado para Idade:</b> de 05 à 12 Anos.\r\n\r\nO Tobogã barco pirata como o próprio nome diz, tem o formato de um navio antigo de piratas. Possui as janelas, o mastro, tudo igual um navio, possui também um pula-pula em seu interior. É um brinquedo grande, e que chama muito a atenção das crianças e dos adultos. \r\n\r\n<b>Especificações do Produto</b>\r\nAltura: 4,5 Metros\r\nLargura: 8,5 Metros\r\n\r\n<b>Mais fotos:</b>', 'Tobogã Barco Pirata', '', 'inherit', 'closed', 'closed', '', '55-revision-v1', '', '', '2019-01-23 09:16:43', '2019-01-23 11:16:43', '', 55, 'http://temporario.agenciasense.com.br/pulapula/2019/01/23/55-revision-v1/', 0, 'revision', '', 0),
