(196, 1, '2019-01-23 11:01:16', '2019-01-23 13:01:16', '<b>Pula Pula Casinha</b>\r\n<b>Recomendado para Idade:</b> de 01 à 10 Anos.\r\n\r\nO Pula-Pula Casinha possui um colchão inflável, paredes e teto inflável, garantindo uma maior segurança para as crianças. Possui janelinha também para visualização dos pais.\r\n\r\n<b>Especificações do Produto</b>\r\nAltura: x Metros\r\nLargura: X Metros\r\n\r\n<b>Mais fotos:</b>\r\n', 'Pula Pula Casinha', '', 'publish', 'closed', 'closed', '', 'pula-pula-casinha', '', '', '2019-01-23 11:07:57', '2019-01-23 13:07:57', '', 0, 'http://temporario.agenciasense.com.br/pulapula/?page_id=196', 0, 'page', '', 0),
