(218, 1, '2019-01-23 11:13:27', '2019-01-23 13:13:27', '<b>Pula Pula Sapinho</b>\r\n<b>Recomendado para Idade:</b> de 01 à 12 Anos.\r\n\r\nA Cama elástica é como se fosse um pula-pula, mas com estrutura em ferro. Possui grande semelhança com aqueles usados em circo. Os saltos nela são maiores do que no pula-pula, portanto, se você busca uma diversão maior para as crianças ela é uma boa opção.\r\n\r\n<b>Especificações do Produto</b>\r\nAltura: X Metros\r\nLargura: X Metros\r\n\r\n<b>Mais fotos:</b>\r\n\r\n\r\n', 'Cama Elástica Média', '', 'publish', 'closed', 'closed', '', 'cama-elastica-media', '', '', '2019-01-23 11:13:27', '2019-01-23 13:13:27', '', 0, 'http://temporario.agenciasense.com.br/pulapula/?page_id=218', 0, 'page', '', 0),
