(221, 1, '2019-01-23 11:19:57', '2019-01-23 13:19:57', '<b>Tobogã com Piscina de Bolinhas</b>\r\n<b>Recomendado para Idade:</b> de 01 à 10 Anos.\r\n\r\nO Tobogã com piscina de bolinhas é um escorregador inflável, no qual a criança sobe pela lateral e escorrega para dentro de uma piscina inflável dentro do próprio brinquedo. Ideal para festas de aniversários por 2 em 1.\r\n\r\n<b>Especificações do Produto</b>\r\nAltura: 3,5 Metros\r\nLargura: 2,5 Metros\r\nProfundidade: 4,5 Metros\r\n\r\n<b>Mais fotos:</b>\r\n\r\n\r\n', 'Tobogã com Piscina de Bolinhas', '', 'publish', 'closed', 'closed', '', 'toboga-com-piscina-de-bolinhas', '', '', '2019-01-23 15:58:25', '2019-01-23 17:58:25', '', 0, 'http://temporario.agenciasense.com.br/pulapula/?page_id=221', 0, 'page', '', 0),
