(258, 1, '2019-01-23 13:05:51', '2019-01-23 15:05:51', '<b>Tombo legal</b>\r\n<b>Recomendado para Idade:</b> de 01 à 07 Anos.\r\n\r\nO Tombo legal é um brinquedo no qual a criança fica sentada em um banquinho suspenso, e seu amigo deve acertar uma bolinha na mira. Se ele acertar, a cadeira abaixa e a criança cai em uma piscina de bolinhas. \r\n\r\n<b>Especificações do Produto</b>\r\nAltura: X Metros\r\nLargura: X Metros\r\n\r\n<b>Mais fotos:</b>\r\n\r\n\r\n', 'Tombo legal', '', 'publish', 'closed', 'closed', '', 'tombo-legal', '', '', '2019-01-23 13:05:51', '2019-01-23 15:05:51', '', 0, 'http://temporario.agenciasense.com.br/pulapula/?page_id=258', 0, 'page', '', 0),
