(261, 1, '2019-01-23 13:07:20', '2019-01-23 15:07:20', '<b>Pula Pula Sapinho</b>\r\n<b>Recomendado para Idade:</b> a partir de 05 Anos.\r\n\r\nO famoso Touro mecânico é um dos principais brinquedos de competições, bastante utilizados em eventos de festas juninas e julinas. A criança ou o adulto deve conseguir ficar o maior tempo possível em cima do touro, se cair a brincadeira acaba. O brinquedo possui sua base toda inflável impossibilitando que a pessoa caia e se machuque.\r\n\r\n<b>Especificações do Produto</b>\r\nAltura: X Metros\r\nLargura: X Metros\r\n\r\n<b>Mais fotos:</b>\r\n\r\n\r\n', 'Touro Mecânico Fantasia', '', 'publish', 'closed', 'closed', '', 'touro-mecanico-fantasia', '', '', '2019-01-23 13:07:20', '2019-01-23 15:07:20', '', 0, 'http://temporario.agenciasense.com.br/pulapula/?page_id=261', 0, 'page', '', 0),
