(267, 1, '2019-01-23 15:57:53', '2019-01-23 17:57:53', '<b>Tobogã com Piscina de Bolinhas</b>\r\n<b>Recomendado para Idade:</b> de 01 à 10 Anos.\r\n\r\nO Tobogã com piscina de bolinhas é um escorregador inflável, no qual a criança sobe pela lateral e escorrega para dentro de uma piscina inflável dentro do próprio brinquedo. Ideal para festas de aniversários por 2 em 1.\r\n\r\n<b>Especificações do Produto</b>\r\nAltura: 6,5 Metros\r\nLargura: 4,8 Metros\r\n\r\n<b>Mais fotos:</b>\r\n\r\n\r\n', 'Tobogã com Piscina de Bolinhas', '', 'inherit', 'closed', 'closed', '', '221-revision-v1', '', '', '2019-01-23 15:57:53', '2019-01-23 17:57:53', '', 221, 'https://turmadopulapula.com.br/2019/01/23/221-revision-v1/', 0, 'revision', '', 0),
(268, 1, '2019-01-23 15:58:25', '2019-01-23 17:58:25', '<b>Tobogã com Piscina de Bolinhas</b>\r\n<b>Recomendado para Idade:</b> de 01 à 10 Anos.\r\n\r\nO Tobogã com piscina de bolinhas é um escorregador inflável, no qual a criança sobe pela lateral e escorrega para dentro de uma piscina inflável dentro do próprio brinquedo. Ideal para festas de aniversários por 2 em 1.\r\n\r\n<b>Especificações do Produto</b>\r\nAltura: 3,5 Metros\r\nLargura: 2,5 Metros\r\nProfundidade: 4,5 Metros\r\n\r\n<b>Mais fotos:</b>\r\n\r\n\r\n', 'Tobogã com Piscina de Bolinhas', '', 'inherit', 'closed', 'closed', '', '221-revision-v1', '', '', '2019-01-23 15:58:25', '2019-01-23 17:58:25', '', 221, 'https://turmadopulapula.com.br/2019/01/23/221-revision-v1/', 0, 'revision', '', 0),
(269, 1, '2019-01-23 15:58:39', '2019-01-23 17:58:39', '<b>Tobogã Grande</b>\r\n<b>Recomendado para Idade:</b> a partir de 05 anos.\r\n\r\nO Tobogã grande é um escorregador inflável, com um pula-pula na frente, podendo ser utilizado para crianças e adultos. É um brinquedo que chama atenção por onde passa devido a sua altura e suas cores. \r\n\r\n<b>Especificações do Produto</b>\r\nAltura: 6,5 Metros\r\nLargura: 4,8 Metros\r\n\r\n<b>Mais fotos:</b>\r\n\r\n\r\n', 'Tobogã Grande', '', 'inherit', 'closed', 'closed', '', '224-revision-v1', '', '', '2019-01-23 15:58:39', '2019-01-23 17:58:39', '', 224, 'https://turmadopulapula.com.br/2019/01/23/224-revision-v1/', 0, 'revision', '', 0),
(270, 1, '2019-01-23 15:58:59', '2019-01-23 17:58:59', '<b>Tobogã Jacaré</b>\r\n<b>Recomendado para Idade:</b> de 01 à 12 Anos.\r\n\r\nO Tobogã Jacaré é um escorregador inflável no formato de um jacarezinho; é ideal para eventos e festas de aniversário com o tema de animais. É um brinquedo totalmente seguro com paredes nas laterais impossibilitando que a criança saia do brinquedo.\r\n\r\n<b>Especificações do Produto</b>\r\nAltura: 5 Metros\r\nLargura: 6,5 Metros\r\nProfundidade: 3 Metros\r\n\r\n<b>Mais fotos:</b>\r\n\r\n\r\n', 'Tobogã Jacaré', '', 'inherit', 'closed', 'closed', '', '227-revision-v1', '', '', '2019-01-23 15:58:59', '2019-01-23 17:58:59', '', 227, 'https://turmadopulapula.com.br/2019/01/23/227-revision-v1/', 0, 'revision', '', 0),
(271, 1, '2019-01-23 15:59:19', '2019-01-23 17:59:19', '<b>Tobogã Stander</b>\r\n<b>Recomendado para Idade:</b> de 01 à 14 Anos.\r\n\r\nO Tobogã Stander é um escorregador inflável com entrada nas laterais e uma grande lona para escorregar. Possui paredes em todos os lados garantindo uma melhor segurança.\r\n\r\n<b>Especificações do Produto</b>\r\nAltura: 6 Metros\r\nLargura: 5 Metros\r\nProfundidade: 3 Metros\r\n\r\n<b>Mais fotos:</b>', 'Tobogã Stander', '', 'inherit', 'closed', 'closed', '', '99-revision-v1', '', '', '2019-01-23 15:59:19', '2019-01-23 17:59:19', '', 99, 'https://turmadopulapula.com.br/2019/01/23/99-revision-v1/', 0, 'revision', '', 0),
(272, 1, '2019-01-23 15:59:35', '2019-01-23 17:59:35', '<b>Tobogã Mini</b>\r\n<b>Recomendado para Idade:</b> de 0 à 05 Anos.\r\n\r\nO Tobogã Mini é um escorregador inflável voltado para o público infantil, indicado para os bebês. Pode ser instalado até nos menores locais por não ser muito alto. Possui paredes em todos os lados garantindo uma maior segurança para as crianças e visualização dos pais.\r\n\r\n<b>Especificações do Produto</b>\r\nAltura: 3 Metros\r\nLargura: 3,5 Metros\r\nProfundidade: 3,5 Metros\r\n\r\n<b>Mais fotos:</b>\r\n\r\n\r\n', 'Tobogã Mini', '', 'inherit', 'closed', 'closed', '', '230-revision-v1', '', '', '2019-01-23 15:59:35', '2019-01-23 17:59:35', '', 230, 'https://turmadopulapula.com.br/2019/01/23/230-revision-v1/', 0, 'revision', '', 0),
(273, 1, '2019-01-23 15:59:51', '2019-01-23 17:59:51', '<b>Tobogã Baby</b>\r\n<b>Recomendado para Idade:</b> de 0 à 05 Anos.\r\n\r\nO Tobogã baby é um escorregador inflável voltado para o público infantil, indicado para os bebês. Pode ser instalado até nos menores locais por não ser muito alto. Possui paredes em todos os lados garantindo uma maior segurança para as crianças e visualização dos pais.\r\n\r\n<b>Especificações do Produto</b>\r\nAltura: 3,5 Metros\r\nLargura: 3,5 Metros\r\nProfundidade: 3,2 Metros\r\n\r\n<b>Mais fotos:</b>\r\n\r\n\r\n', 'Tobogã Baby', '', 'inherit', 'closed', 'closed', '', '233-revision-v1', '', '', '2019-01-23 15:59:51', '2019-01-23 17:59:51', '', 233, 'https://turmadopulapula.com.br/2019/01/23/233-revision-v1/', 0, 'revision', '', 0),
(274, 1, '2019-01-23 16:00:04', '2019-01-23 18:00:04', '<b>Torre de Alpinismo</b>\r\n<b>Recomendado para Idade:</b> de 05 à 10 Anos.\r\n\r\nA Torre de Alpinismo é um brinquedo na qual a criança precisa escalar uma torre com a ajuda de uma corda e chegar até o topo. Um brinquedo radical e seguro, pois possui cinto de segurança e capacete. \r\n\r\n<b>Especificações do Produto</b>\r\nAltura: 5 Metros\r\nLargura: 5 Metros\r\nProfundidade: 5 Metros\r\n\r\n<b>Mais fotos:</b>\r\n\r\n\r\n', 'Torre de Alpinismo', '', 'inherit', 'closed', 'closed', '', '255-revision-v1', '', '', '2019-01-23 16:00:04', '2019-01-23 18:00:04', '', 255, 'https://turmadopulapula.com.br/2019/01/23/255-revision-v1/', 0, 'revision', '', 0),
